INSERT INTO `blog_article` (`id`, `title`, `description`, `content`, `click_count`, `is_recommend`, `date_publish`, `author_id`, `category_id`, `tag_id`, `photo`) VALUES (3674,'2018年7月5日18:07:02 日记','生活感慨感悟感触','<p>回家时间两周零两天，接到父亲的电话，匆忙从哈尔滨回到龙江，奶奶开始可以攒一段力气，说上几句话，无非就是对母亲如何的不满，到现在已经有一个礼拜连一句话都说不清楚，父亲从头看到现在，最近很是辛苦，病情的严重，使奶奶更加难以维持一个状态太长时间，需要父亲不断的扶起和放平躺下，很是折磨人，晚上也睡不好觉，父亲是一位很孝顺的人，回家已有两个多星期，也是最近才看是疲惫与有些烦躁，俗话&ldquo;久病无孝子&rdquo;，想来也不无道理，但是终究还是耐心并尽力的伺候着奶奶，我说我来吧，奶奶还在推攘不许，从小心疼我的奶奶，见到她被这恶病折磨成这个样子，心里着实难受的紧，晚上去接母亲放羊回家，琢磨自己平淡而无为的小半生，除了有些怨气，不会排解，大概没什么值得骄傲的事情了。自认为是一个朝气不足的人，无论生理还是心理，也是，没在有些不舒服的情况下，自己才会去清理脑袋里的垃圾，或许这就是病吧。一场生下来就携带的病，无药可救的病，在想什么时候才能不那么怂，怂，简单的一个字，短暂的人生的完美总结。</p>\r\n\r\n<p>有些感慨感触感悟，会把人，搞迷糊。</p>',0,'0','2018-07-08',1,1,NULL,'https://avatars1.githubusercontent.com/u/25276575?');
